import React from "react";
import login_keys from "../../images/login_keys_removebg.png"

export default function SignIn() {
    return (
        <div className="login">
            <div className='login-header'>
                Virtual closet
            </div>
            <img
                className="login-keys"
                src={login_keys}
            >

            </img>
        </div>
    );
}
